import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="app-title">
          <h1 className="header">Smart Tool</h1>
          <div className="dropdown-area"></div>
        </div>
      </header>
    </div>
  );
}

export default App;
